import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Calendar from './calendar/Calendar';
import CalendarAddPop from './calendar/CalendarAddPop';
import MainHome from './home/Home';
import Board from './board/Board';
import BoardAddPop from './board/BoardAddPop';
import reportWebVitals from './reportWebVitals';
import {Route,BrowserRouter,Routes} from 'react-router-dom';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
     <BrowserRouter>
        <Routes>
          <Route path="/" element={<MainHome/>}/>
          <Route path="/Board" element={<Board/>}/>
          <Route path="/Board/BoardAddPop" element={<BoardAddPop/>}/>
          <Route path="/Calendar" element={<Calendar/>}/>
          <Route path="/Calendar/CalendarAddPop" element={<CalendarAddPop/>}/>
        </Routes>
      </BrowserRouter>
    </div>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
